export function DateValidator() {
  return control => {
    if (!control.value || !control.value.length) {
      return null;
    }
    const today = new Date().getTime();
    const userDate = new Date(control.value).getTime();
    if (userDate > today) {
      return {
        futureDate: {
          value: control.value
        }
      };
    }
    return null;
  };
}
